    <script type="text/javascript" >
      google.load("visualization", "1.1", {packages:['table','corechart','line']});
      // Raw Data
      function drawRawData() {
        google.visualization.drawChart({
          "containerId": "raw_data_div",
          "dataSourceUrl": "//www.google.com/fusiontables/gvizdata?tq=",
          "query":"SELECT 'Dist', 'Roll', 'Pitch', 'Yaw', 'DistErr', 'DistVariance', 'RollErr', 'PitchErr', 'YawErr', 'RotationErr', 'RotationVariance', 'FPS', 'DR', 'Layout' FROM " +
                  "167MneM1hnWPIv7N7OwrAz9gXMzxJHl8HA0TFXsI3",
          "refreshInterval": 120,
          "chartType": "Table",
          "options": {showRowNumber: true, width: '100%', height: '100%'}
       });
      }
      
      google.setOnLoadCallback(drawRawData);
    </script>
